const products = [
  { id: 1, name: "Плов" },
  { id: 2, name: "Манты" },
  { id: 3, name: "Лагман" },
  { id: 4, name: "Самса" },
  { id: 5, name: "Куурдак" },
  { id: 6, name: "Бешбармак" },
  { id: 7, name: "Шорпо" },
  { id: 8, name: "Чучук" },
  { id: 9, name: "Казы" },
  { id: 10, name: "Шашлык" },
];

function ProductCard({ product, images }) {
  const randomImage = images[Math.floor(Math.random() * images.length)];

  const handleBuy = () => {
    console.log(`ID: ${product.id}, Название: ${product.name}`);
  };

  return (
    <div className="card">
      <img src={randomImage} alt={product.name} />
      <h3>{product.name}</h3>
      <button onClick={handleBuy}>Buy now</button>
    </div>
  );
}

function App() {
  return (
    <div className="container">
      <h1>Национальные блюда Средней Азии</h1>
      <div className="grid">
        {products.map((product) => (
          <ProductCard key={product.id} product={product} images={imageSamples} />
        ))}
      </div>
    </div>
  );
}

export default App;
